  false,\n\t\"url\": null,\n\t\"notes\": \"The GOA/AI Bottom Trawl Estimate database
  contains abundance estimates for the Alaska Biennial Bottom Trawl Surveys conducted
  in the Gulf of Alaska and the Aleutian Islands in alternate years.  The estimates
  build upon raw and summary data available from the RACEBASE database and include
  calculated catch-per-unit-effort (cpue)s for principal species of groundfish and
  key invertebrates for each survey region.  The cpues are averaged by survey strata,
  and then average cpues are multiplied by stratum areas which results in estimates
  of biomass and numerical abundance.  Length and age data are combined with abundance
  to estimate the population at length and sex and population at age and sex.\",\n\t\"license_title\":
